import React from 'react';
import './skills.css';

import UIDesign from '../../assests/Images/ui-design.png';
import WebDesign from '../../assests/Images/website-design.png';
import AppDesign from '../../assests/Images/app-design.png';


const Skills = () => {
  return (
   <section id='skills'>
    <span className="skillTitle">What I do</span>
    <span className="skillDesc">I am profoundly passionate about software development, where each line of code becomes a brushstroke on the canvas of innovation, allowing me to craft solutions and bring digital dreams to life.</span>

   <div className="skillBars">
    <div className="skillBar">
        <img src={UIDesign} alt="" className="skillBarImg" />
        <div className="skillBarText">
            <h2></h2>
            <p></p>
        </div>
    </div>

   </div>

   </section>
  )
}

export default Skills
